import '@walletconnect/react-native-compat';
import '@ethersproject/shims';
import 'fast-text-encoding';
import React, { useEffect } from 'react';
import Home from './Components/Home';
import { SafeTransactionDataPartial } from '@safe-global/safe-core-sdk-types';
import AppProvider from './providers/AppProvider';
import FaceScan from './Components/FaceScan';
import { QRCamera } from './Components/QRCamera';
import { Waiting } from './Components/Waitings';
import { Success } from './Components/Success';
import { useEvmAddress } from './hooks/useEvmAddress';
import { useView } from './hooks/useView';
import { Button } from 'react-native';
import Safe, { EthersAdapter } from '@safe-global/protocol-kit';
import { ethers } from 'ethers';
import { connectToWallet } from './utils/convertFaceDataToWallet';
import SafeApiKit from '@safe-global/api-kit';

export type Views = 'home' | 'qrCamera' | 'frontCamera' | 'waiting' | 'success';

interface Config {
  RPC_URL: string;
  SIGNER_ADDRESS_PRIVATE_KEY: string;
  SAFE_ADDRESS: string;
  TX_SERVICE_URL: string;
  SAFE_TX_HASH: string;
}

const App: React.FC = () => {
  const { view, setView } = useView();
  const { address } = useEvmAddress();

  // useEffect(() => {
  //   if (address && view === 'frontCamera') setView('frontCamera');
  // }, [address]);

  const rpcUrl =
    'https://delicate-solitary-arrow.ethereum-goerli.discover.quiknode.pro/380d1d7b867ca55fc31ef04300580c9fd2ef2e11';

  const createTransaction = async () => {
    try {
      const wallet = connectToWallet('123');
      // @ts-ignore
      console.log('wallet.address', wallet.getHdKey(), wallet.address);
      const provider = new ethers.providers.JsonRpcProvider(rpcUrl);

      // @ts-ignore
      const signer = new ethers.Wallet(wallet.getHdKey()?.privKey, provider);

      const ethAdapter = new EthersAdapter({
        ethers,
        signerOrProvider: signer,
      });

      const safeSdk = await Safe.create({
        ethAdapter,
        safeAddress: '0xFf00000000000000000000000000000000042069',
      });

      const safeTransactionData: SafeTransactionDataPartial = {
        to: '0xFf00000000000000000000000000000000042069',
        value: '236763113948451520',
        data: '',
      };

      const safeTransaction = await safeSdk.createTransaction({
        safeTransactionData,
      });

      console.log('safeTransaction', safeTransaction);
    } catch (error) {
      // @ts-ignore
      console.log(`Error message: ${error.message}`);
    }
  };
  return (
    <AppProvider>
      <Button onPress={() => createTransaction()} />
      {view === 'home' ? (
        <Home view={view} setView={setView} />
      ) : view === 'qrCamera' ? (
        <QRCamera setView={setView} />
      ) : view === 'frontCamera' ? (
        <FaceScan setView={setView} />
      ) : view === 'waiting' ? (
        <Waiting setView={setView} />
      ) : view === 'success' ? (
        <Success setView={setView} />
      ) : (
        <></>
      )}
    </AppProvider>
  );
};

export default App;

